        alignItems="center"
        style={{height:'100px', backgroundColor:'rgba(0,0,0,0.7)'}}>
            <Grid item sm={4}>
            </Grid>

            <Grid item sm={4}>
            </Grid>

            <Grid item sm={4}>
            </Grid>
        </Grid>

    )
}

export default Footer;
